import { Redirect } from "react-router-dom";
import { useState } from 'react'

const Lastpage = ({userName}) => {
    
    let [redi,setRedirect] = useState(false)
    function homePage(e){
        e.preventDefault()
        setRedirect(redi=true)
    }

    if(redi === true){
        return <Redirect to='/'/>
    }

    return (
        <div>
            <nav id="nav-bar" >
                <div className="container2">
                    <button onClick={homePage} className='logout btn2'>Logout</button>
                </div>
            </nav>
            <h1>Psych You thought {userName.user}  </h1>
        </div>
    )
}

export default Lastpage
